import React, { useEffect, useState } from "react";
import axios from "axios";
import { userBooking } from "../actions/BookingAction";

function PrintScreen() {
  const [userbookings, setUserbooking] = useState([]);
  useEffect(() => {
    axios
      .get("http://localhost:5000/api/booking/userbooking/:id")
      // .then((response) => response.json())
      // .then((data) => setData(data))
      .then((res) => {
        console.log(res);
        setUserbooking(res.data);
      })
      .catch((err) => {
        console.log(err);
      });
  }, []);

  return (
    <div>
      <h1>Thank You for registering</h1>
      <p>PLease don't forget to carry your photo id and print out copy </p>
      <button>Print Copy</button>

      <ul>
        {userbookings.map((userbooking) => (
          <li key={userBooking.id}>{userBooking.name}</li>
        ))}
      </ul>
    </div>
  );
}

export default PrintScreen;
